import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Icon, Image } from "antd";
import HomePage from "../src/HomePage.jsx";
import SellPage from "./SellPage.jsx";
import BillingPage from "./BillingPage.jsx";
import SuccessPage from "./SuccessPage.jsx";
import "./App.css";
import "antd/dist/antd.css";

function App() {
  return (
    <Router>
      <div style={{ backgroundColor: "#3366cc", height: "10%" }}>
        <img
          src="https://www.theindiaforum.in/sites/default/files/field/image/2019/10/01/Ramkumar%20Radhakrishnan%2C%20Wikimedia-1569929663.jpeg"
          alt="img"
        />
        <Link to="/">
          <h1
            style={{
              color: "white",
              display: "inline-block",
              fontStyle: "italic",
              marginLeft: "8%",
              paddingTop: "2px"
            }}
          >
            {" "}
            &nbsp; transFarmer
          </h1>
        </Link>
        <Link>
          <Icon
            type="shopping-cart"
            style={{
              float: "right",
              fontSize: "32px",
              marginTop: "10px",
              marginRight: "10%",
              color: "white"
            }}
          />
        </Link>
      </div>
      <Route path="/" exact component={HomePage} />
      <Route
        path="/sell"
        exact
        render={props => <SellPage {...props} type="sell" />}
      />
      <Route
        path="/buy"
        exact
        render={props => <SellPage {...props} type="buy" />}
      />
      <Route
        path="/sell/billing"
        render={props => <BillingPage {...props} type="sell" />}
      />
      <Route
        path="/buy/billing"
        render={props => <BillingPage {...props} type="buy" />}
      />
      <Route
        path="/sell/success"
        render={props => <SuccessPage {...props} type="sell" />}
      />
      <Route
        path="/buy/success"
        render={props => <SuccessPage {...props} type="buy" />}
      />
    </Router>
  );
}

export default App;
